import './App.css';

import Data from './data.json';
function App() {
  return (
    <div className="App">
      {
        Data.map(data => {
          return (
            <table className="box">
              <tr>
              <th>id</th>
              <th>firstname</th>
              <th>lastname</th>
              <th>age</th>
              <th>city</th>
              <th>address</th>
              </tr>
              <tr>
                <td>{data.id}</td>
                <td>{data.firstname}</td>
                <td>{data.lastname}</td>
                <td>{data.age}</td>
                <td>{data.city}</td>
                <td>{data.address}</td>
              </tr>
            </table>
          )
        })
      }
    </div>
  );
}
export default App;
